export default function Table(){
    return(
        <div className="container-fluid">
            <table className="table-info p-5 mt-3"> 
                <thead>    
                        <th scope="col">id</th>
                        <th scope="col">nombre</th>
                        <th scope="col">telefono celular</th>
                    </thead>                   
                </table>
        </div>
    );

}
